import React, { useEffect, useState } from 'react'
import DataTable from 'react-data-table-component'
import axios from 'axios'
import Insert from  "../form/Insert"
import DeleteIcon from '@mui/icons-material/Delete';
import VisibilityIcon from '@mui/icons-material/Visibility';
import EditIcon from '@mui/icons-material/Edit';

import Modal from '@mui/material/Modal';
import Button from '@mui/material/Button';




  
const Userprofile = () => {
  const [search, setSearch] = useState("");
  const [c_data, setc_data] = useState([]);
  const [filterdata, setfilter] = useState([]);
//  const [stud,setstud] = useState(null)

 const [anchorEl, setAnchorEl] = useState(null);
 const [view,setView] = useState()
const [show, setShow] = useState(false);
 const [showModel, setShowModel] = useState(false);

 const handleClose = () => setShowModel(false);
 const handleShow = () => setShowModel(true);


// show---------------------------------------------
  // const [open, setOpen] = useState(false);

  // const handleOpen =async (id) =>{
  //   setOpen(true);
  //   try{
      
  //   const res = await axios.get(`http://192.168.1.30:8070/stud/view/${id}`);
  //   console.log(res.data.data)
  //   setstud(res.data.data)

   
  //   }catch(error)
  //   {
  //     console.log(error);
  //   }
  // } 
  

   const [open, setOpen] = useState(false);
  const openDialog = async (id)=> {
     setAnchorEl(null);
     console.log("IDDDDD", id);
     setOpen(true);
     const data = await axios
       .get(`http://192.168.1.30:8070/stud/view/${id}`)
       .then((res) => {
         console.log("VIEWDATA",res.data.data)
         setView(res.data.data);
       })
       .catch((err) => {
         console.log(err);
       });
   };

   const closeDialog = () => setOpen(false);
  //data table------------------------------------------- 
  const getdata = async () => {
    try {
      const res = await axios.get("http://192.168.1.30:8070/stud/view");
      console.log(res.data)
      setc_data(res.data);
      setfilter(res.data);
    }
    catch (error) {
      console.log(error);
    }
  };
  const columns = [
    {
      name: "FullName",
      selector: (row) => row.FullName,
      sort: true

    },
    {
      name: "fatherName ",
      selector: (row) => row.fatherName
    },
    {
      name: "motherName ",
      selector: (row) => row.motherName
    },
    // {
    //   name: "F_occupation",
    //   selector: (row) => row.F_occupation
    // },
    // {
    //   name: "M_occupation ",
    //   selector: (row) => row.M_occupation
    // },
    {
      name: "email",
      selector: (row) => row.email
    },
    {
      name: "phone ",
      selector: (row) => row.phone
    },
    {
      name: "address",
      selector: (row) => row.address
    },
    // {
    //   name: "city ",
    //   selector: (row) => row.city
    // },
    {
      name: "gender",
      selector: (row) => row.gender
    },
    {
      name: "Class",
      selector: (row) => row.Class
    },
    {
      name: "Rollno",
      selector: (row) => row.Rollno
    },
    {
       name: "action",
       cell: (row) => <>
        <VisibilityIcon  onClick={() => {openDialog(row._id) ; handleShow()}} ></VisibilityIcon>
       <EditIcon></EditIcon>
        <DeleteIcon onClick={()=>deletestudent(row._id)}>delete</DeleteIcon>
      
       </>
    }

  ]
  useEffect(() => {
    getdata();
  }, []);

  useEffect(() => {
    const result = c_data.filter(val => {
      console.log("filert")

      return val.email.toLowerCase().match(search.toLowerCase());

    });

    setfilter(result);
  }, [search]);
// delete----------------------------------------
  function deletestudent(_id){
    fetch(`http://192.168.1.30:8070/stud/view/delete/${_id}`,{
      method:"DELETE"
    }).then((r)=>{
      r.json().then((resp)=>{
        console.log(resp); 
        getdata();
      })
    })
  }


  // ------------------------------------------------------
  return (
    <>
      <div className='page'>
      
        <h1 className=' text-center'>student Data</h1>
        
        {
          show ?  <Insert /> : ""
        }
         <button onClick={()=>setShow(!show)} className="insert"> { show ? "X":"create student"}</button>
       {
          show ? "": <DataTable
          title="Student list"
          columns={columns}
          data={filterdata}
          pagination
          fixedHeader
          fixedHeaderScrollHeight='550px'
          selectableRows
          selectableRowsHighlight
          highlightOnHover
          subHeader
          subHeaderAlign="left"
          subHeaderComponent={
            <input
              type="text"
              placeholder='search'
              className='w-25 form-control'
              value={search}
              onChange={(event) => setSearch(event.target.value)} />
          }
        />
       }
      </div>



 

      <Modal show={showModel} onHide={handleClose} animation={false}>
        <Modal.Header closeButton>
          <Modal.Title>Modal heading</Modal.Title>
        </Modal.Header>
        <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <Button variant="primary" onClick={handleClose}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>

  


    </>
  )
}

export default Userprofile
